(function (){
  var el = document.createElement('style');
  el.setAttribute('type', 'text/css');
  document.head.appendChild(el);
  var sheet = el.sheet;
  function addRule(rule){
    try { sheet.insertRule(rule, sheet.rules.length); }
    catch (e) { console.warn('Error inserting rule', rule, e); }
  }
  addRule('@font-face { font-family: \'Material Icons\';font-style: normal;font-weight: 400;src: url(MaterialIcons-Regular.eot);src: local(\'Material Icons\'),local(\'MaterialIcons-Regular\'),url(MaterialIcons-Regular.woff2) format(\'woff2\'),url(MaterialIcons-Regular.woff) format(\'woff\'),url(MaterialIcons-Regular.ttf) format(\'truetype\'); }');
  addRule('.material-icons { font-family: \'Material Icons\';font-weight: 400;font-style: normal;font-size: 24px;display: inline-block;line-height: 1;text-transform: none;letter-spacing: normal;word-wrap: normal;white-space: nowrap;direction: ltr;-webkit-font-smoothing: antialiased;text-rendering: optimizeLegibility;-moz-osx-font-smoothing: grayscale;font-feature-settings: \'liga\'; }');
  
})();
